import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header className={"header1"}/>
    </div>
  );
}

function Header({content}){
  return (
    <div>

<h1>this is a header</h1>
    <br></br>
    <h3>{content}</h3>
    </div>
  )
}

export default App;
